namespace OwensT {
    public static class ExpectedN16 {
        static readonly (MultiPrecision<Pow2.N16> x, MultiPrecision<Pow2.N16> w)[] gls;

        static ExpectedN16(){
            gls = p201.Select((v) => ((MultiPrecision<Pow2.N16>)v.x, (MultiPrecision<Pow2.N16>)v.w)).ToArray();
        }

        public static MultiPrecision<Pow2.N16> Value(MultiPrecision<Pow2.N16> h, MultiPrecision<Pow2.N16> a) {
            if (a <= 4 || h >= 4) {
                return GaussQuadrature(h, a);
            }

            if (h * a <= 32) { // erf(h * a / sqrt(2)) < 1
                MultiPrecision<Pow2.N16> c = (1 - MultiPrecision<Pow2.N16>.Erf(h / MultiPrecision<Pow2.N16>.Sqrt2) * MultiPrecision<Pow2.N16>.Erf(h * a / MultiPrecision<Pow2.N16>.Sqrt2)) / 4;
                MultiPrecision<Pow2.N16> t = GaussQuadrature(h * a, 1 / a);

                if (c < t * 2) {
                    throw new ArithmeticException($"digit loss {h}, {a}");
                }

                MultiPrecision<Pow2.N16> y = c - t;

                return y;
            }
            else {
                MultiPrecision<Pow2.N16> y = MultiPrecision<Pow2.N16>.Erfc(h / MultiPrecision<Pow2.N16>.Sqrt2) / 4;

                return y;
            }
        }

        public static MultiPrecision<Pow2.N16> GaussQuadrature(MultiPrecision<Pow2.N16> h, MultiPrecision<Pow2.N16> a) {
            MultiPrecision<Pow2.N16> h2 = h * h, n_half_h2 = -h2 / 2;

            MultiPrecision<Pow2.N16> ig = MultiPrecision<Pow2.N16>.Sqrt(MultiPrecision<Pow2.N16>.PI / 2) / h
                * MultiPrecision<Pow2.N16>.Exp(n_half_h2) * MultiPrecision<Pow2.N16>.Erf(h * a / MultiPrecision<Pow2.N16>.Sqrt2);

            MultiPrecision<Pow2.N16> x_peak = MultiPrecision<Pow2.N16>.Sqrt(MultiPrecision<Pow2.N16>.Sqrt(h2 + 8) / (2 * h) - MultiPrecision<Pow2.N16>.Point5);
            MultiPrecision<Pow2.N16> ap = MultiPrecision<Pow2.N16>.Min(a, x_peak * 2);
            MultiPrecision<Pow2.N16> ad = MultiPrecision<Pow2.N16>.Min(a, x_peak * 19) - ap;

            MultiPrecision<Pow2.N16> sp = 0, sd = 0;
            
            for (int k = 0; k < gls.Length; k++) {
                (MultiPrecision<Pow2.N16> x, MultiPrecision<Pow2.N16> w) = gls[k];
                MultiPrecision<Pow2.N16> x_sft = x * ap;

                MultiPrecision<Pow2.N16> p = x_sft * x_sft;
                MultiPrecision<Pow2.N16> r = 1 + p;

                MultiPrecision<Pow2.N16> u = w * MultiPrecision<Pow2.N16>.Exp(n_half_h2 * r) * p / r;

                sp += u;
            }

            if (ad > 0) { 
                for (int k = 0; k < gls.Length; k++) {
                    (MultiPrecision<Pow2.N16> x, MultiPrecision<Pow2.N16> w) = gls[k];
                    MultiPrecision<Pow2.N16> x_sft = x * ad + ap;

                    MultiPrecision<Pow2.N16> p = x_sft * x_sft;
                    MultiPrecision<Pow2.N16> r = 1 + p;

                    MultiPrecision<Pow2.N16> u = w * MultiPrecision<Pow2.N16>.Exp(n_half_h2 * r) * p / r;

                    sd += u;

                    if (u.Exponent < sd.Exponent - MultiPrecision<Pow2.N16>.Bits) {
                        break;
                    }
                }
            }

            MultiPrecision<Pow2.N16> y = (ig - sp * ap - sd * ad) / (2 * MultiPrecision<Pow2.N16>.PI);

            return y;
        }

